package javaBasic;

public class Topic_05_Primitive_Casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		double num = 10.85d;
				
		int a = (int)num;
		
		System.out.println(a);
		
		float num1 = 10.4f;
		
		int b = (int)num1;
		
		System.out.println(b);
		
	}

}
